import React from "react";
import { Container, Col, Row, Card } from "react-bootstrap";
import "./Projects.css";
import a from "./images/projects/a";


const Items = (props) => {
    return ( 
        <div className="item_list col-md-12">
            <Container fluid>
            <Row>
            <Col md={6}>
            <Container>
                <Card.Img variant="top" src={props.pic} />
            </Container>
            </Col>

            <Col md={6}>
            <Container>
                <h1>{props.name}</h1>
            </Container>
            </Col>
            </Row>
            </Container>
        </div>
     );
}


export default function Projects() {
  return (
      <>
    <Container>

        <div style={{textAlign:"left", marginTop: "80pt"}}>
            <h1 className="display-6">Projects</h1>
            <p> magni dolores eos qui ratione voluptatem sequi nesciunt.<br /> Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur</p>
        </div>
    </Container><br /><br /><br />

    <Items name="Food_Delivery"/>
    <Items name="Food_Delivery"/>
    <Items name="Food_Delivery"/>
    </>
  )
}
